import React, {useState, useEffect} from "react";
import "./Farm.css";

function Farm(props) {
  const [toggle, setToggle] = useState
  const URL = `https://qa.manna-irrigation.com:8443/omer/api/v2/fields?farm_id=${props.key}`;
  const fetchFields = async () => {
    try {
      console.log(props.token);
      const myHeaders = new Headers({
        "Content-Type": "application/json",
        "X-User-Api-Token": props.token,
      });
      let response = await fetch(URL, {
        method: "GET",
        headers: myHeaders,
      });

      if (response.status === 200) {
        let data = await response.json();
        console.log(data);
      }
    } catch (e) {}
  };

  useEffect(() => {
    fetchFields(props.token);
  }, []);

  return (
    <div>
      <div className="farmBox">
        <button
          className="accordion-btn"
          onClick={() => {
            props.toggleFunc(props.nameid);
          }}
        >
          {props.nameid}
          {/* <span className="accent"> # Of Fields: {props.fields.length}</span> */}
        </button>
        <div
          className={props.open ? `accordionContent` : `accordionContent show`}
        >
          {/* {props.fields.map((field) => (
            <ul className="list">
              <li>{field}</li>
            </ul>
          ))} */}
        </div>
      </div>
    </div>
  );
}

export default Farm;
